import React, { useState } from 'react';
import { Box, Button, TextField, MenuItem, Grid } from '@mui/material';
import axios from 'axios';

const ProfileForm = ({ onProfileSubmit, onMatchResults }) => {
  const [profile, setProfile] = useState({
    physical: {
      age: '',
      weight: '',
      height: '',
      sex: 'male'
    },
    demographics: {
      race: 'white',
      location: 'north_america'
    },
    medical_history: {
      preexisting_conditions: [],
      prior_conditions: [],
      surgeries: [],
      active_medications: []
    },
    lifestyle: {
      athleticism: 'moderate',
      diet: 'omnivore'
    }
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      onProfileSubmit(profile);
      const response = await axios.post('http://localhost:8000/match/', profile);
      onMatchResults(response.data);
    } catch (error) {
      console.error('Error matching profile:', error);
    }
  };

  const handleChange = (section, field) => (event) => {
    setProfile(prev => ({
      ...prev,
      [section]: {
        ...prev[section],
        [field]: event.target.value
      }
    }));
  };

  return (
    <Box component="form" onSubmit={handleSubmit}>
      <Grid container spacing={2}>
        {/* Physical Characteristics */}
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            label="Age"
            type="number"
            value={profile.physical.age}
            onChange={handleChange('physical', 'age')}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            label="Weight (lbs)"
            type="number"
            value={profile.physical.weight}
            onChange={handleChange('physical', 'weight')}
          />
        </Grid>
        {/* Add more fields following the same pattern */}

        <Grid item xs={12}>
          <Button 
            variant="contained" 
            color="primary" 
            type="submit"
            fullWidth
          >
            Match Profile
          </Button>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ProfileForm;
